fields.welcome_email_msg:
Dear {user.first_name},

Thankyou for joining {chapter.name}!

Your username and password for myRobogals can be found below:

Username: {user.username}
Password: {plaintext_password}
Login at https://my.robogals.org

Regards,

{chapter.name}

fields.invite_email_msg:
Hello,

{visit.chapter.name} will be conducting a workshop soon:
When: {visit.visit_time}
Location: {visit.location}
School: {visit.school.name}

For more information, and to accept or decline this invitation to volunteer at this workshop, please visit https://my.robogals.org/teaching/{visit.pk}/

Thanks,

{user.first_name}

